import React from 'react'
import Box  from '../Utilities/Box'

function SupportPage() {
  return (
    <div id='support' className='sm:p-8 p-0 flex justify-around flex-wrap'>
        <Box header={'Inviting Others'} body={'The Harvest is large, but the Workers are few, help by inviting someone'}/>
        <Box header={'Finacial Support'} body={'The Harvest is large, but the Workers are few, help by inviting someone'}/>
        <Box header={'By Your Prayers'} body={'The Harvest is large, but the Workers are few, help by inviting someone'}/>
    </div>
  )
}

export default SupportPage
